class UFT {
private:
  vi data, rnk, _size;

public:
  UFT(const int &n)
    : data(n), rnk(n), _size(n, 1) {
    iota(all(data), 0);
  }

  int root(const int &x) {
    return data[x] == x ? x : data[x] = root(data[x]);
  }

  bool same(const int &a, const int &b) {
    return root(a) == root(b);
  }

  void unite(int a, int b) {
    a = root(a), b = root(b);
    if (a == b) return;
    if (rnk[a] < rnk[b]) swap(a, b);
    data[b] = a;
    _size[a] += _size[b];
    if (rnk[a] == rnk[b]) rnk[a]++;
  }

  int size(int x) {
    return _size[root(x)];
  }
};

void solve() {
  int n, k;
  cin >> n >> k;
  UFT uf(n);
  while (k--) {
    int m;
