	int i = 0;
	while (primes[i] < a) 
	{
		if (a % primes[i] == 0)
			list[a_len++] = primes[i];
		i++;
		if (len <= i)
			break;
	}
	return a_len++;
}

int key(int *list, int len)
{
	int sum = 0;
	for (int i = 0; i < len - 1; i++) 
		sum += list[i];
	return list[len-1] - sum;


}

