vector<int> factor(int x){
    int d=3, q;
    vector<int> vc;
    while( x >= 4 && (x % 2) == 0 ){
        vc.push_back( 2 );
        x /= 2;
    }
    q = x / d;
    while( q >= d ){
        if( (x % d) == 0 ){
            vc.push_back( d );
            x = q;
        }else{
            d += 2;
        }
        q = x / d;
    }
    vc.push_back( x );
    sort( vc.begin()  , vc.end() );
   	vc.erase( unique( vc.begin() , vc.end() ) , vc.end() );
    return vc;
}

int key_number(int x){
	vector<int> v = factor(x);
	int sum = 0;
	for(int i=0 ; i < v.size()-1 ; i++ ){
		sum += v[i];
	}
	return v[v.size()-1] - sum;
}

