      k++;
    }
    else break;
  }
  for(int i=3;;i+=2){
    if(n==1) break;
    while(1){
      if(n%i==0){
	n/=i;
	num[k]=i;
	k++;
      }
      else break;
    }
  }

  sort(num, num+k);

  int sum=0;
  int max=num[k-1];

  for(int i=0;i<k;i++){
    sum+=num[i];
  }

  return max-sum;
}

