void integerFactorization(int n, vector<int>& base, vector<int>& expo)
{
    base.clear();
    expo.clear();
    int a = 2;
    while(a * a <= n){
        int b = 0;
        while(n % a == 0){
            ++ b;
            n /= a;
        }
        if(b > 0){
            base.push_back(a);
            expo.push_back(b);
        }
        ++ a;
    }
    if(n > 1 || base.size() == 0){
        base.push_back(n);
        expo.push_back(1);
    }
}

int keyNumber(int a)
{
    vector<int> base, expo;
    integerFactorization(a, base, expo);

    int ret = base[base.size()-1];
    for(unsigned i=0; i<base.size()-1; ++i)
        ret -= base[i];
    return ret;
}

