const int MAX = 1000001;
bool prime[MAX];
int a,b;
vector<int> V;


void make(){
  fill(prime,prime+MAX,true);

  prime[0] = prime[1] = false;

  for(int i = 2; i*i < MAX; i++)
    if(prime[i])
      for(int j = 2; i*j < MAX; j++)
	prime[i*j] = false;

  for(int i = 2; i < MAX; i++)
    if(prime[i]) V.push_back(i);  
}

int solve(int n){

  int sum = 0,last;
  for(int i = 0; i < V.size(); i++){
    if(V[i] > n) break;
    if(n%V[i] == 0){
      sum += V[i];
      last = V[i];
    }
  }

  sum -= last;
  return last-sum;
}

int main(){

  make();
  while(cin >> a >> b && a+b){
    int ans_a = solve(a);
    int ans_b = solve(b);

    if(ans_a > ans_b) cout << "a" << endl;
    else cout << "b" << endl;
  }

  return 0;
}

