bool flg[1000100];
vector<int> p;

void mkPrime(void){
	memset(flg,true,sizeof(flg));
	flg[0] = flg[1] = false;

	for(int i=2;i<=1000010;i++){
		if(flg[i]){
			for(int j=i+i;j<=1000010;j+=i){
				flg[j] = false;
			}
		}
	}

	for(int i=0;i<=1000010;i++){
		if(flg[i]){
			p.push_back(i);
		}
	}
}

int solve(int x){
	int res = 0;
	int last = 0;
	for(int i=0;p[i]<x;i++){
		if(x % p[i] == 0){
			res -= p[i];
			last = i;
		}
	}

	return res + 2 * p[last];
}

int main(void){
	mkPrime();

	int a,b;
	while(cin>>a>>b, a){
		int remA = solve(a);
		int remB = solve(b);

		cout<<(remA > remB ? "a" : "b")<<endl;
	}

	return 0;
}

