int f(int n){
	set<int> s; 
	int sum = 0 , maximum = 0;
	for(int i = 2 ; i*i <= n ; i++){
		if(n%i==0){
			s.insert(i);
			while(n%i==0){ n/=i; }
		}
	}
	if(n != 1) s.insert(n);

	for(set<int>::iterator it = s.begin(); it != s.end() ; ++it)
		sum += *it;

	return 2 * (*s.rbegin()) - sum;
}

