bool IsPrime[1000001];
vector<int> Prime;

void PrimeCalc()
{
	fill(IsPrime, IsPrime + 1000001, true);
	for(int i = 2; i < 1000001; ++i)
	{
		if(IsPrime[i])
		{
			Prime.push_back(i);
			for(int j = i * 2; j < 1000001; j += i)
			{
				IsPrime[j] = false;
			}
		}
	}
}

int func(int a)
{
	set<int> Set;
	for(int i = 0; Prime[i] <= a; ++i)
	{
		if(a % Prime[i] == 0)
		{
			Set.insert(Prime[i]);
		}
	}
	int sum = 0;
	set<int>::iterator It;
	for(It = Set.begin(); It != Set.end(); ++It)
	{
		sum -= *It;
	}
	--It;
	sum += *It * 2;
	return(sum);
}

