int bunkai(int n){
  int num[10000];
  int k=0;
  while(1){
    if(n%2==0){
      n/=2;
      num[k]=2;
      k++;
    }
    else break;
  }
  for(int i=3;;i+=2){
    if(n==1) break;
    while(1){
      if(n%i==0){
	n/=i;
	num[k]=i;
	k++;
      }
      else break;
    }
  }

  sort(num, num+k);

  int sum=0;
  int max=num[k-1];

  for(int i=0;i<k-1;i++){
    sum+=num[i];
  }

  return max-sum;
}

