    for(auto a: am) {
      suma -= a.first;
      last = a.first;
    }
    suma += last * 2;

    long long sumb = 0;
    for(auto b: bm) {
      sumb -= b.first;
      last = b.first;
    }
    sumb += last * 2;

    if(suma > sumb) cout << 'a' << endl;
    else cout << 'b' << endl;
  }
