int calc(int x){

  int sum = 0, max = 0;
  for(int i=2;i<=x;++i){
    if(x%i==0){
      sum += i;
      max = i;

      while(x%i==0){
        x /= i;
      }
    }
  }

  return max - (sum - max);
}

int main(){
