map<ll,int> prime_factorization(ll n){
	map<ll,int> ret;

	for(ll div=2;div<=1+sqrt(n);div++){
		while(n%div==0){
			ret[div]++;
			n/=div;
		}
	}
	if(n!=1)ret[n]++;
	return ret;
}


ll solve(int n){
	map<ll,int> mp = prime_factorization(n);
	vector<int> v;
	for(auto &elm:mp){
		v.pb(elm.first);
	}
	int ans = v[v.size()-1];
	rep(i,v.size()-1)ans-=v[i];
	return ans;
}

int main(){
	assert(solve(20)==3);
	int a,b;
	while(cin>>a>>b&&(a||b)){
		ll ra = solve(a);
		ll rb = solve(b);
		if(ra>rb)cout<<'a'<<endl;
		else cout<<'b'<<endl;
	}
}

