int prime[50000],size;

bool isPrime(int x){
	double to = sqrt(x);
	for(int i=0;i<size && prime[i]<=to;i++){
		if(x % prime[i] == 0) return false;
	}
	return true;
}

void mkPrime(void){
	prime[0] = 2;
	size = 1;
	for(int i=3;i<=500100;i+=2) if(isPrime(i)) prime[size++]=i;
}

int key(int x){
	int ans=0, t=0, max=-99999999, to=x/2+1;

	for(int i=0;prime[i]<=to;i++){
		if(x % prime[i] == 0){
			t++;
			ans -= prime[i];
			if(max < prime[i]) max = prime[i];
		}
	}

	switch(t){
	case 0: return x;
	case 1: return max;
	default: return ans + 2 * max;
	}
}

int main(void){
	int a,b;
	mkPrime();
	while(cin>>a>>b && (a||b)){
		if(key(a) > key(b)) cout<<"a\n";
		else cout<<"b\n";
	}
	return 0;
}

