	for(int i=2;i*i<=p;i++){
		if(p%i==0){
			sum+=i;c=i;
			while(p%i==0)p/=i;
		}
	}
	if(p>=2){
		sum+=p;c=p;
	}
	return c*2-sum;
}
int main(){
	int a,b;
	while(true){
		cin>>a>>b;
		if(a==0 && b==0)break;
		int v=keyn(a);
		int w=keyn(b);
		if(v>w)cout<<'a'<<endl;
		else cout<<'b'<<endl;
	}
}

